  `create_user_name` varchar(128) NOT NULL COMMENT '反馈人员名字',
  `content` text NOT NULL COMMENT '反馈内容',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态（默认0：未处理，1：已经处理）',
  `remark` text COMMENT '备注',
