-- ----------------------------
-- Table structure for gcategory_relation
-- ----------------------------
DROP TABLE IF EXISTS `gcategory_relation`;
CREATE TABLE `gcategory_relation` (
  `id` varchar(64) NOT NULL,
  `gcate_id` int(10) unsigned NOT NULL COMMENT '类型',
  `relation_gcate_id` int(10) unsigned NOT NULL COMMENT '关系类型',
  `relation_id` int(10) unsigned NOT NULL COMMENT '关系 cate_id',
  PRIMARY KEY (`id`),
  KEY `FK_Reference_29` (`relation_gcate_id`),
  KEY `FK_Reference_30` (`gcate_id`),
  KEY `FK_Reference_31` (`relation_id`),
  CONSTRAINT `FK_Reference_29` FOREIGN KEY (`relation_gcate_id`) REFERENCES `goods_gcategory` (`id`),
  CONSTRAINT `FK_Reference_30` FOREIGN KEY (`gcate_id`) REFERENCES `goods_gcategory` (`id`),
  CONSTRAINT `FK_Reference_31` FOREIGN KEY (`relation_id`) REFERENCES `sys_mdict` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品类别之间的关系（产业带）';

