DROP TABLE IF EXISTS `supply_demand_recommend`;
CREATE TABLE `supply_demand_recommend` (
  `id` varchar(64) NOT NULL,
  `create_date` datetime DEFAULT NULL COMMENT '推荐时间',
  `recommend_user` varchar(64) NOT NULL COMMENT '推荐人',
  `recommend_type` varchar(64) NOT NULL COMMENT '推荐类型（platform:平台推荐，company:机构推荐）',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态（默认0:正常，-1：取消推荐）',
  `object_type` int(1) NOT NULL COMMENT '0:供求信息，1：供应商，2：求购商）',
  `object_id` varchar(64) NOT NULL COMMENT '供求id或者用户id',
  `position_id` char(10) DEFAULT NULL,
  `url` varchar(10) DEFAULT NULL,
  `start_time` datetime DEFAULT NULL COMMENT '推荐开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '推荐结束时间',
  PRIMARY KEY (`id`),
  KEY `FK_Reference_71` (`position_id`),
  CONSTRAINT `FK_Reference_71` FOREIGN KEY (`position_id`) REFERENCES `sys_position` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='推荐表';

