  `recommend_id` varchar(64) NOT NULL COMMENT '推荐id',
  PRIMARY KEY (`id`),
  KEY `FK_Reference_59` (`recommend_id`),
  CONSTRAINT `FK_Reference_59` FOREIGN KEY (`recommend_id`) REFERENCES `supply_demand_recommend` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='推荐标签';

