DROP TABLE IF EXISTS `supply_offer_order_download_log`;
CREATE TABLE `supply_offer_order_download_log` (
  `id` varchar(64) NOT NULL,
  `order_id` varchar(64) NOT NULL COMMENT '某人总的报价单',
  `uploading_log_id` varchar(64) NOT NULL COMMENT '上传的order_ID',
  `download_user` varchar(255) DEFAULT NULL COMMENT '下载人',
  `ip` varchar(128) NOT NULL COMMENT '下载ip',
  `download_time` datetime NOT NULL,
  PRIMARY KEY (`id`),
