  KEY `FK_Reference_63` (`uploading_log_id`),
  CONSTRAINT `FK_Reference_62` FOREIGN KEY (`order_id`) REFERENCES `supply_offer_order` (`id`),
  CONSTRAINT `FK_Reference_63` FOREIGN KEY (`uploading_log_id`) REFERENCES `supply_offer_order_uploading_log` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='报价单下载历史记录';

